// SPDX-License-Identifier: MIT

pragma solidity 0.5.7;

interface IFactory{

    function issueSecurity(address security, bytes32 company, bytes32 isin, bytes32 currency, address issuer, bool qualified, bytes32 _hashedMessage, uint8 _v, bytes32 _r, bytes32 _s) 
                            external;

    function getSecurityToken(address security, address issuer) external view returns(address, bytes32, bytes32, bytes32, bool);
    
    function addBalance(address security, address transferor, address transferee, uint256 amount, bytes32 _hashedMessage, uint8 _v, bytes32 _r, bytes32 _s) 
                            external;

    function checkProduct(address issue) external view returns(bool);

    function getIssues() external view returns(address[] memory);

    function getHolder(address security) external view returns(address);

    function getSecurity(address securityToken) external view returns(address);

    function setCustodian(address _securityToken, address _issuer, address _custodian) external;

    function getCustodian(address _securityToken, address _issuer) external view returns(address);
    
}
